$SPEC{parse_mandiri_account} = {
    v => 1.1,
    summary => 'Parse/validate Mandiri account number',
    description => <<'_',

Upon success/valid number, return status 200 with hash containing parsed
information. Upon invalid number, return 400. Parsed information contains these
keys:

- `account` (13-digits)
- `account_f` (canonically-formatted account number, e.g. 120.0007799880)

_
    args => {
        account => {
            schema => 'str*',
            req => 1,
            pos => 0,
        },
    },
};
sub parse_mandiri_account {
    my %args = @_;

    my $acc = $args{account};
    defined($acc) or return [400, "Please specify account"];
    $acc =~ s/\D+//g;
    length($acc) == 13 or return [400, "Account number must be 13 digits"];

    my $parsed = {account=>$acc};

    my ($branch, $local) = $acc =~ /^(.{3})(.{10})$/;
    $parsed->{account_f}   = sprintf("%s.%s", $branch, $local);
    $parsed->{branch_code} = $branch;

    # XXX check known branches

    [200, "OK", $parsed];
}

